import React from 'react';
import "./Engineer.css"
import resume from './resume.pdf'

function Engineer() {
  return (
    <div className="engineerDiv">
      <h1 className="emilyHeading engineerText">emily lobel</h1>
      <h2 className="rainbowText">nice to meet you :)</h2>
      <p className="engParagraph">i'm currently an engineer at ellevest</p>
      <p className="engParagraph">i've previously worked at buzzfeed and girls who code</p>
      <p className="engParagraph">i enjoy singing karaoke</p>
      <ul className="linkList">
        <li>
          <Link to={resume} className="engineerText">resume</Link>
        </li>
        <li>linkedin</li>
        <li>github</li>
        <li>email</li>
      </ul>
    </div>
  );
}

export default Engineer;
